import "../css/login.css";

export const Login = () => {
  return (
    <div className="page login_page">
      <div className="login_container">
        {/* 로그인 헤더 */}
        <header className="login_header"></header>
        {/* 로그인 내용 */}
        <div className="login_content">
          <form action="post">
            <input type="" />
            <input type="password" />
          </form>
        </div>
        {/* 로그인 풋터 */}
        <footer className="login_footer"></footer>
      </div>
    </div>
  );
};
